&lt;p&gt;
	I agree with the inspection results but have since carried out the following improvements:the establishment has been thoroughly cleaned and procedures are in place to ensure that cleanliness is maintained; a new management system has been implemented and staff have been trained/retrained.&lt;/p&gt;
&lt;p&gt;
	The conditions at the time of the inspection were not typical of normal working conditions and arose because our chef left us at very short notice on 4 November and our new chef only started 4 days prior to the inspection.&amp;nbsp; The previous chef had plainly not been managing the standards of hygiene and paperwork that we had set.&amp;nbsp; Our schedule of works (shared with the council) show that many of the requirements have been completed and all remaining works are scheduled for completion week commencing 6/1/25.&amp;nbsp; We have also set up staff training for &amp;#39;food safety and allergens&amp;#39; for completion early in the New Year.&lt;/p&gt;
&lt;p&gt;
	We&amp;#39;ll be submitting a request for a food hygiene rating rescore revisit shortly.&lt;/p&gt;
